CREATE FUNCTION item_changed() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
BEGIN
    IF TG_OP = 'DELETE'
    THEN
        RETURN NEW;
    ELSE
        UPDATE playlist SET duration = (SELECT SUM(duration) FROM item WHERE playlist = NEW.playlist);
    END IF;
 RETURN NEW;
END;
$$;


